import React, { Component, Fragment } from 'react';
import { Col, Container, Row } from 'react-bootstrap';

class Doctor extends Component {
    render() {
        return (
            <Fragment>
                <Container className="text-center">
                    <Row>
                        <Col>
                            <h1>Qualified Doctors</h1>
                            <h4>Separated they live in. A small river named Duden flows by their place and supplies it with the necessary regelialia. It is a paradisematic country</h4>
                        </Col>
                    </Row>
                </Container>
            </Fragment>
        );
    }
}

export default Doctor;
